import "../attraction/attraction.css";
import Navbar from "../../components/navbar/Navbar";
import Header from "../../components/header/Header";
import o1 from "../../images/o1.jpg";
import o2 from "../../images/o2.jpg";
import o3 from "../../images/o3.jpg";
import o4 from "../../images/o4.jpg";
import o5 from "../../images/o5.jpg";
import o6 from "../../images/o6.jpg";


const Ooty = () => {
  return (
    <div>
        <Navbar/>
        <Header type="list"/>
    <div className="outerBox">
    <div className="searchItem img-box">
      <img
        src={o1}
        alt=""
        className="siImg"
      />
      <p className="desc">Ajanta Caves: Ajanta Caves, a UNESCO World Heritage Site in Maharashtra, India, is an ancient masterpiece carved into rock cliffs. These caves house breathtaking murals, sculptures, and intricate architecture dating back to the 2nd century BCE. They offer a glimpse into India's rich Buddhist history and artistry.
</p>
      </div>
      <div className="searchItem img-box">
      <img
        src={o2}
        alt=""
        className="siImg"
      /><p className="desc">Ajanta Caves: Ajanta Caves, a UNESCO World Heritage Site in Maharashtra, India, is an ancient masterpiece carved into rock cliffs. These caves house breathtaking murals, sculptures, and intricate architecture dating back to the 2nd century BCE. They offer a glimpse into India's rich Buddhist history and artistry.
      </p>
      </div><div className="searchItem img-box">
      <img
        src={o3}
        alt=""
        className="siImg"
      /><p className="desc">Ajanta Caves: Ajanta Caves, a UNESCO World Heritage Site in Maharashtra, India, is an ancient masterpiece carved into rock cliffs. These caves house breathtaking murals, sculptures, and intricate architecture dating back to the 2nd century BCE. They offer a glimpse into India's rich Buddhist history and artistry.
      </p>
      </div><div className="searchItem img-box">
      <img
        src={o4}
        alt=""
        className="siImg"
      /><p className="desc">Ajanta Caves: Ajanta Caves, a UNESCO World Heritage Site in Maharashtra, India, is an ancient masterpiece carved into rock cliffs. These caves house breathtaking murals, sculptures, and intricate architecture dating back to the 2nd century BCE. They offer a glimpse into India's rich Buddhist history and artistry.
      </p>
      </div><div className="searchItem img-box">
      <img
        src={o5}
        alt=""
        className="siImg"
      /><p className="desc">Ooty Rose Garden is a mesmerizing garden in the heart of the town of Ooty, in Tamil Nadu. It is also known as the Jayalalithaa Rose Garden, the Nootrandu Roja Poonga and the Centenary Rose Park. Nature lovers are drawn to the Rose Garden like bees to honey.
      </p>
      </div><div className="searchItem img-box">
      <img
        src={o6}
        alt=""
        className="siImg"
      /><p className="desc">Ajanta Caves: Ajanta Caves, a UNESCO World Heritage Site in Maharashtra, India, is an ancient masterpiece carved into rock cliffs. These caves house breathtaking murals, sculptures, and intricate architecture dating back to the 2nd century BCE. They offer a glimpse into India's rich Buddhist history and artistry.
      </p>
      </div>

    </div>
  </div>
  );
};

export default Ooty;
